import {footer, blog, possibility, features, gpt3} from './containers';
import {brand, navbar, cta,} from './components';
function App() {
  return (
    <div className="App">
      <div className="gradient_bg">
        <navbar/>
        <header/>
      </div>
        <brand/>
        <gpt3/>
        <features/>
        <possibility/>
        <cta/>
        <blog/>
        <footer/>
    </div>
  );
}

export default App;
